<!DOCTYPE html>
<html lang="">
  <head>
    <meta content='width=device-width, initial-scale=1, maximum-scale=1, user-scalable=no' name='viewport'>
    <link href="https://maxcdn.bootstrapcdn.com/font-awesome/4.3.0/css/font-awesome.min.css" rel="stylesheet" type="text/css" />
    <link href="http://code.ionicframework.com/ionicons/2.0.0/css/ionicons.min.css" rel="stylesheet" type="text/css" />
    <link href="<%= BASE_URL %>bootstrap/css/bootstrap.min.css" rel="stylesheet" type="text/css" />
    <link href="<%= BASE_URL %>dist/css/AdminLTE.min.css" rel="stylesheet" type="text/css" />
    <link href="<%= BASE_URL %>dist/css/skins/_all-skins.min.css" rel="stylesheet" type="text/css" />
    <link href="<%= BASE_URL %>plugins/datatables/dataTables.bootstrap.css" rel="stylesheet" type="text/css" />
    <title><%= htmlWebpackPlugin.options.title %></title>
  </head>
  <body class="register-page">
    <noscript>
      <strong>We're sorry but <%= htmlWebpackPlugin.options.title %> doesn't work properly without JavaScript enabled. Please enable it to continue.</strong>
    </noscript>
    <div id="app"></div>
    <!-- built files will be auto injected -->
  </body>
  <!-- jQuery 2.1.3 -->
  <script src="<%= BASE_URL %>plugins/jQuery/jQuery-2.1.3.min.js"></script>
  <!-- jQuery UI 1.11.2 -->
  <script
    src="http://code.jquery.com/ui/1.11.2/jquery-ui.min.js"
    type="text/javascript"
  ></script>
  <!-- Resolve conflict in jQuery UI tooltip with Bootstrap tooltip -->
  <script>
    $.widget.bridge("uibutton", $.ui.button);
  </script>
  <!-- Bootstrap 3.3.2 JS -->
  <script src="<%= BASE_URL %>bootstrap/js/bootstrap.min.js" type="text/javascript"></script>
  <!-- iCheck -->
  <script src="<%= BASE_URL %>plugins/iCheck/icheck.min.js" type="text/javascript"></script>
  <!-- Slimscroll -->
  <script
    src="<%= BASE_URL %>plugins/slimScroll/jquery.slimscroll.min.js"
    type="text/javascript"
  ></script>
  <!-- FastClick -->
  <script src="<%= BASE_URL %>plugins/fastclick/fastclick.min.js"></script>
  <!-- AdminLTE App -->
  <script src="<%= BASE_URL %>dist/js/app.min.js" type="text/javascript"></script>
  <script src="<%= BASE_URL %>plugins/datatables/jquery.dataTables.js" type="text/javascript"></script>
    <script src="<%= BASE_URL %>plugins/datatables/dataTables.bootstrap.js" type="text/javascript"></script>
    

  
</html>
